import './Login.css';
import React from 'react';
import { Link, NavLink, BrowserRouter, Route, Routes } from 'react-router-dom';

const Login = () => {
    return (
        <div>

            <h1>Login</h1>            
            <p>이곳은 로그인 페이지 입니다.</p>            

            <Link to={"./Sign_up"}>계정 만들기</Link>                  

        </div>
    );
};

export default Login;
